Aujourd'hui j'ai envie de vous parler d'un sujet qui me tiens à coeur et qui peut toutes nous toucher : le BABY BLUES..

On nous en parle peu voir pas pendant la grossesse et quand ça nous arrive, c'est la douche froide.. Il faut savoir que derrière ces non-dits,  près de 60% des femmes sont touchées par ce phénomène.. 
Bien loin des préjugés, ce n'est pas réservé aux femmes qui ne sont pas prête à être maman.. J'attendais mon fils avec impatience et j'en ai eu un..💥 Un bien costaud qui a évolué vers une dépression post partum précoce.. 
Le baby blues dure en moyenne 10 jours; j'ai vécu avec pendant plus d'un mois.. Un traitement homéopathique et le soutien de mon mari et mon entourage et du repos m'ont aidé à sortir la tête de l'eau.. 

Je pense que mon épisiotomie a beaucoup contribué à cet état d'esprit.. Je n'ai pas vraiment pu m'occuper de lui comme je le voulais.. Et du coup j'ai remis mon rôle de maman en question pendant plusieurs semaines.. J'étais pourtant très bien encadré par mon entourage.

Alors mesdames, si vous passez par cette période, c'est normal. N'oubliez pas que vous n'êtes pas seule et surtout sachez que vous êtes des mamans fabuleuses. ❤

Et vous, vous avez vécu cette expérience de quelle manière ? 

